class Trie:
    def __init__(self):
        self.root = [None]*26
        self.end = False

    def idx(self,word):
        return ord(word) - 96

    def insert(self,letter):
        node = self
        for word in letter:
            index = self.idx(word)
            if node.root[index] == None:
                node.root[index] = Trie()
            node=node.root[index]
        node.end = True

    def search(self, search):
        node = self
        for word in search:
            index = self.idx(word)
            if node.root[index] == None:
                return False
            node = node.root[index]
        return node.end

    def starts_with(self,prefix):
        node = self
        for word in prefix:
            index = self.idx(word)
            if node.root[index] == None:
                return False
            node = node.root[index]
        return True

t = Trie()
t.insert('')
print(t.search('aaaaaaaaaaaaaaaaaaaa'))
print(t.starts_with('aaaa'))

